import React, { Component } from 'react';
import './Explorer.css';

class Explorer extends Component {
  render() {
    return (
      <div className="explorer">
        <div className="explorer-head">
          <h3 className="explorer-title">actions</h3>
          <ul>
            <li>-</li>
            <li>+</li>
            <li>x</li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Explorer;
